import {
    Section,
    Title,
    ListOfFollowers,
    Follower,
    FollowerPicture,
} from "./styles";

const FollowersContainer = (props) => {
    return (
        <Section>
            <Title>Followers </Title>
            <ListOfFollowers>
                {(props?.followers).map((follower) => (
                    <Follower>
                        <h2>{follower?.login}</h2>
                    </Follower>
                ))}
                <FollowerPicture>{follower?.url}</FollowerPicture>
            </ListOfFollowers>
        </Section>
    );
};

export default FollowersContainer;
